import React from "react";

function SideBar(){
    return (
        <>
        <div className="flex flex-col bg- rounded-md bg-opacity-40 p-4">
            <span>DashBoard</span>
            <span>Add Transaction</span>
            <span>History</span>
            <span>Incomes</span>
        </div>
        </>
    )
}

export default SideBar
